import React from 'react'

export default class TitleBar extends React.Component {

    render() {
        return(
            <div className='title-bar'>
                <h1>Klaus</h1>
                <p>Betting becomes so easy</p>
                <img id='lock-img' src="data:image/svg+xml;base64,"></img>
            </div>
        )
    }
}
